import React from 'react'
import "./Menu.css" 
import MenuItem from '../MenuItem/MenuItem'


const Menu = ({menuItems}) => {
  return (
    <div className='Menu__container'>
        {menuItems.map((item, index) => {
            <MenuItem />
        })}
    </div>
  )
}

export default Menu
